import Link from 'next/link';
import { Button, Layout } from 'antd';

export default ({ children }) => {
  return (
    <Layout>
      <Layout.Header></Layout.Header>
      <Layout.Content>{children}</Layout.Content>
      <Layout.Footer>
        Develop by ZJJ @<a href=""></a>
      </Layout.Footer>
    </Layout>
  );
};
